export const Searchbar = () => {
  return (
    <>
      <form>
        <button></button>
        <input
          name="inputData"
          type="text"
          autoFocus
          autoComplete="on"
          placeholder="Search for a city"
        />
        <button></button>
      </form>
    </>
  );
};
